import React from 'react'

function SunIcon() {

  return (
    <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-brightness-high-fill" viewBox="0 0 16 16">
      <path d="M12 8a4 4 0 1 1-8 0 4 4 0 0 1 8 0zM8 0a.5.5 0 0 1 .5.5v2a.5.5 0 0 1-1 0v-2A.5.5 0 0 1 8 0zm0 13a.5.5 0 0 1 .5.5v2a.5.5 0 0 1-1 0v-2A.5.5 0 0 1 8 13zm8-5a.5.5 0 0 1-.5.5h-2a.5.5 0 0 1 0-1h2a.5.5 0 0 1 .5.5zM3 8a.5.5 0 0 1-.5.5h-2a.5.5 0 0 1 0-1h2A.5.5 0 0 1 3 8zm10.657-5.657a.5.5 0 0 1 0 .707l-1.414 1.415a.5.5 0 1 1-.707-.708l1.414-1.414a.5.5 0 0 1 .707 0zm-9.193 9.193a.5.5 0 0 1 0 .707L3.05 13.657a.5.5 0 0 1-.707-.707l1.414-1.414a.5.5 0 0 1 .707 0zm9.193 2.121a.5.5 0 0 1-.707 0l-1.414-1.414a.5.5 0 0 1 .707-.707l1.414 1.414a.5.5 0 0 1 0 .707zM4.464 4.465a.5.5 0 0 1-.707 0L2.343 3.05a.5.5 0 1 1 .707-.707l1.414 1.414a.5.5 0 0 1 0 .708z"/>
    </svg>
  );
}

function MoonIcon() {

  return (
    <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-moon-fill" viewBox="0 0 16 16">
    <path d="M6 .278a.768.768 0 0 1 .08.858 7.208 7.208 0 0 0-.878 3.46c0 4.021 3.278 7.277 7.318 7.277.527 0 1.04-.055 1.533-.16a.787.787 0 0 1 .81.316.733.733 0 0 1-.031.893A8.349 8.349 0 0 1 8.344 16C3.734 16 0 12.286 0 7.71 0 4.266 2.114 1.312 5.124.06A.752.752 0 0 1 6 .278z"/>
  </svg>

  );
}

const NavBar = ({toggleTheme, isDarkMode}) => {
  return (
        <nav className={`navbar navbar-${isDarkMode ? 'light' : 'dark'} bg-${isDarkMode ? 'light' : 'dark'} fixed-top`} style={{
          position: 'sticky'
        }}>
        <div class="container-fluid">
          <a class="navbar-brand" href="/">📰 DigiNews</a>
          <div
            style={{
              display: 'flex',
              gap: '1rem',
            }}
          >
          <button class={`text-${!isDarkMode ? 'light' : 'dark'}`} type="button" aria-controls="offcanvasDarkNavbar"
            style={{
              border: 'none',
              backgroundColor: 'transparent',
            }}
            onClick={toggleTheme}
          >
              {
                isDarkMode ? <MoonIcon /> : <SunIcon />
              }
          </button>
          <button class="navbar-toggler" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasDarkNavbar" aria-controls="offcanvasDarkNavbar">
            <span class="navbar-toggler-icon"></span>
          </button>
          </div>
          <div class={`offcanvas offcanvas-end bg-${isDarkMode ? 'light' : 'dark'} text-bg-${isDarkMode ? 'light' : 'dark'}`} tabindex="-1" id="offcanvasDarkNavbar" aria-labelledby="offcanvasDarkNavbarLabel">
            <div class="offcanvas-header">
              <h5 class={`offcanvas-title text-${!isDarkMode ? 'light' : 'dark'}`} id="offcanvasDarkNavbarLabel">DigiNews</h5>
              <button type="button" class={`btn-close btn-close-${!isDarkMode ? 'white' : 'black'}`} data-bs-dismiss="offcanvas" aria-label="Close"></button>
            </div>
            <div class="offcanvas-body">
              <ul class="navbar-nav justify-content-end flex-grow-1 pe-3">
                <li class="nav-item">
                  <a class="nav-link active" aria-current="page" href="/">Home</a>
                </li>
                <li class="nav-item dropdown">
                  <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="true">
                    News Categories
                  </a>
                  <ul class={`dropdown-menu dropdown-menu-${isDarkMode ? 'light' : 'dark'}`}>
                    <li><a class="dropdown-item" href="/trending">Trending</a></li>
                    <li><a class="dropdown-item" href="/business">Business</a></li>
                    <li><a class="dropdown-item" href="/national">National</a></li>
                    <li><a class="dropdown-item" href="/startup">Startup</a></li>
                    <li><a class="dropdown-item" href="/entertainment">Entertainment</a></li>
                    <li><a class="dropdown-item" href="/science">Science</a></li>
                    <li><a class="dropdown-item" href="/world">World</a></li>
                    <li><a class="dropdown-item" href="/sports">Sports</a></li>
                    <li><a class="dropdown-item" href="/technology">Technology</a></li>
                  </ul>
                </li>
              </ul>
            </div>
           </div>
        </div>
      </nav>
    )
}

export default NavBar
